(643, 263, 'Modules\\Product\\Entities\\Product', 'Pheromone Perfume for Women – Long-Lasting Roll-On Fragrance, 2-Pack', 'Pheromone Perfume for Women – Long-Lasting Roll-On Fragrance, 2-Pack', '\"About this item\r\nIngredients: Alcohol(Alcohol Acetone), Fragrance (Perfume),Water, ButylMethoxydibenzoylmethane,Ethylhexyl Methoxycinnamate, Ethylhexyl Salicylate,Butoxyphenol, Neem AcidBenzyl ester, citronellol, chamomile aldehyde,limonene,linalool.\r\nExperience the long-lasting allure of our women\'s perfume. Formulated with high-quality ingredients, this fragrance is designed to linger on your skin throughout the day, offering you confidence and sophistication that lasts from morning till night.\r\nUsing our women\'s perfume is a breeze. Simply apply a few spritzes to your pulse points, such as your wrists, neck, and behind the ears. The lightweight and non-greasy formula quickly absorbs into the skin, leaving you with a delicate and luxurious aroma.\r\nOur women\'s perfume is a secret to successfully grabbing attention from the opposite sex. The carefully selected fragrance notes are known to have a seductive and alluring effect, making you feel confident, empowered, and irresistible in any social or romantic setting.\r\nWe take pride in providing exceptional customer service. Our team is dedicated to ensuring your satisfaction with our women\'s perfume. If you have any questions, concerns, or issues, our friendly and knowledgeable support team is always ready to assist you and provide prompt solutions.\"', '', '', '', '', '', '', '2025-04-18 08:32:00', '2025-04-18 08:32:00'),
