(645, 265, 'Modules\\Product\\Entities\\Product', 'e.l.f. Holy Hydration Skincare Mini Kit – Cleanser, Remover, Moisturizer & Eye Cream, Travel Size', 'e.l.f. Holy Hydration Skincare Mini Kit – Cleanser, Remover, Moisturizer & Eye Cream, Travel Size', '\"About this item\r\nA COMPLETE HYDRATION REGIMEN: This skincare kit has all of your favorite Holy Hydration necessities- a Holy Hydration. Daily Cleanser, Holy Hydration. Makeup Melting Cleansing Balm, Hydrating Booster Drops, Holy Hydration. Face Cream and Eye Cream.\r\nCLEANS and NOURISHES SKIN: This step-by-step skincare regimen will have your face feeling soft, supple and hydrated no matter where you are – think of it as your face’s happily ever after.\r\nINFUSED WITH HYALURONIC ACID: e.l.f. SKIN\'s Hoy Hydration. products are infused with Hyaluronic acid to help hydrate and plump the skin, Ceramides to help build up the skin\'s moisture barrier, and Peptides for refreshing complexion.\r\nTRAVEL-FRIENDLY SIZES: All of the products in the Hydrated Ever After Skincare Mini Kit are travel-friendly sizes so you can take it wherever you go.\r\nVEGAN & CRUELTY-FREE: 100% vegan, e.l.f. is double-certified cruelty-free by Leaping Bunny & PETA.\"', '', '', '', '', '', '', '2025-04-18 08:39:38', '2025-04-18 08:39:38'),
(646, 266, 'Modules\\Product\\Entities\\Product', 'CeraVe Hydrating Facial Cleanser – Face Wash for Dry Skin with Hyaluronic Acid & Ceramides, Eczema Certified', 'CeraVe Hydrating Facial Cleanser – Face Wash for Dry Skin with Hyaluronic Acid & Ceramides, Eczema Certified', '\"About this item\r\n[ HYDRATING FACE WASH ] Daily face wash with hyaluronic acid, ceramides, and glycerin to help hydrate skin without stripping moisture. Removes face makeup, dirt, and excess oil, provides 24-hour hydration and leaves a moisturized, non-greasy feel.\r\n[ ECZEMA FACE WASH ] Non-foaming cleanser for dry skin with a lotion-like consistency feels smooth as it cleanses, even on sensitive, dry skin. Fragrance-free, paraben-free, non-comedogenic and non-drying. Certified by the National Eczema Association\r\n[ MULTI-USE GENTLE CLEANSER ] Cream cleanser for face and/or body and can be used as a hand wash. Suitable for daily cleansing morning (AM) and night (PM) for normal to dry skin. Skin care for dry skin.\r\n[ 3 ESSENTIAL CERAMIDES ] Ceramides are found naturally in the skin and make up 50% of the lipids in the skin barrier. All CeraVe products, formulated with three essential ceramides (1, 3, 6-II)to help maintain the skin’s natural barrier.\r\n[ DEVELOPED WITH DERMATOLOGISTS & #1 DERMATOLOGIST RECOMMENDED SKINCARE BRAND ] CeraVe Skincare is developed with dermatologists and has products suitable for dry skin, sensitive skin, oily skin, acne-prone, and more.\"', '', '', '', '', '', '', '2025-04-18 08:42:19', '2025-04-18 08:42:19'),
(647, 267, 'Modules\\Product\\Entities\\Product', 'SimplyVital Collagen Retinol Cream – Anti-Aging Moisturizer for Face, Neck & Décolleté, 1.7 fl oz', 'SimplyVital Collagen Retinol Cream – Anti-Aging Moisturizer for Face, Neck & Décolleté, 1.7 fl oz', '\"About this item\r\nNourishing Face Moisturizer — Enhance your anti-aging skincare routine with this moisturizing face cream, designed to help your skin feel smooth and refreshed. Collagen supports skin\'s flexibility while promoting a firmer texture for both face and neck. Enjoy a youthful glow with a gentle solution that provides enduring hydration and care.\r\nHow to Use - Apply a small amount to clean, dry skin, massaging until absorbed. Start 1-2 times a week for sensitive skin, then increase as needed. Use daily for optimal results. Always apply SPF 30+ during the day, as retinol may heighten sun sensitivity. Perform a patch test before initial use. Consult a dermatologist before use. Individual sensitivity to components is possible.\r\nAdvanced Retinol Face Cream – Formulated with a balanced concentration of retinol, this moisturizer encourages skin renewal for a smoother, refreshed appearance. Hyaluronic acid complements retinol to help maintain hydration, leaving skin feeling soft and nourished without tightness. Perfect for a well-rounded skincare routine.\r\nProudly Made in the USA – SimplyVital guarantees exceptional quality in each jar. We carefully select effective yet gentle components to create potent formulas, ensuring your skin gets the attention it deserves while enhancing your natural elegance. All our products are crafted in the USA, adhering to the highest manufacturing standards.\"', '', '', '', '', '', '', '2025-04-18 08:45:03', '2025-04-18 08:45:03'),
(648, 268, 'Modules\\Product\\Entities\\Product', 'Vitamin C Serum 20% – Anti-Aging Face Serum with Hyaluronic Acid, Retinol & Amino Acids, 60ml', 'Vitamin C Serum 20% – Anti-Aging Face Serum with Hyaluronic Acid, Retinol & Amino Acids, 60ml', '\"About this item\r\nPlant Based Formulation - Free of synthetic color additives, fragrance, and stabilizers, dynamic active botanicals like Aloe Vera, Witchhazel, Botanical Hyaluronic Acid, Witch Hazel and organic Jojoba oil combine in a silky smooth serum that can be used day or night.\r\nAnti-Aging Vitamin C Serum For Face - As you grow older, the skin loses its vitality, leaving it dull, dry and dehydrated. Vitamin C Serum contains Hyaluronic Acid and botanical blend that helps fight against wrinkles and spots. Including Vitamin C Serum in your daily skin care, helps add moisture on face and skin, nourishes the skin and helps to retain its natural glow.\r\nAdvanced Antioxidant Serum - An indispensable nutrient for collagen production, vitamin C blends with Botanical Hyaluronic Acid and Vitamin E, designed to target the most common signs of aging, including firmness, fine lines, wrinkles, dark spots & sun spots.\r\nStimulate Collagen Formation - Vitamin C is responsible for collagen production. Boosting your skin and body with Vitamin C Serum will enhance the natural formation of collagen that is the number one component for connecting tissues for skin health. No oily residue left behind. Absorbs quickly without a heavy, greasy or sticky feel.\"', '', '', '', '', '', '', '2025-04-18 08:47:36', '2025-04-18 08:47:36'),
(649, 269, 'Modules\\Product\\Entities\\Product', 'Aveeno Protect + Hydrate SPF 60 Sunscreen Lotion – Oil-Free, Paraben-Free with Prebiotic Oat, 12 fl oz', 'Aveeno Protect + Hydrate SPF 60 Sunscreen Lotion – Oil-Free, Paraben-Free with Prebiotic Oat, 12 fl oz', '\"About this item\r\nDaily Sunscreen Lotion: One 12 fl oz lotion pump bottle of Aveeno Protect + Hydrate Sunscreen Broad Spectrum SPF 60 Body Lotion to help protect and provide all-day hydration to skin\r\nMoisturizing Sunscreen Lotion: Made with nourishing prebiotic oat, this lightweight daily sunscreen helps leave skin feeling soft and moisturized all day as it combats sun induced free radicals that accelerate skin-aging\r\nWater Resistant Sunscreen: Featuring effective broad spectrum protection, this sunscreen lotion SPF 60 is paraben, phthalate, oil, oxybenzone and dye free, and is water and sweat-resistant for up to 80 minutes for superior protection from the sun\r\nSun Protection for Adults: Apply this oil free sunscreen 15 minutes before sun exposure and reapply every two hours or more often as directed\r\nDermatologist Recommended Brand for Over 70 Years: Aveeno Protect + Hydrate Body Sunscreen helps prevent sunburn and decreases the risk of skin cancer and early aging caused by the sun when used as directed with other sun protection measures\"', '', '', '', '', '', '', '2025-04-18 08:50:08', '2025-04-18 08:50:08'),
(650, 270, 'Modules\\Product\\Entities\\Product', 'Celavi Korean Essence Face Mask Set – 12-Pack Hydrating Sheet Masks', 'Celavi Korean Essence Face Mask Set – 12-Pack Hydrating Sheet Masks', '\"About this item\r\n12 Essence Set Includes - Collagen, Seaweed, Honey, pomegranate, Aloe Vera, Vitamin C, Acai Berry, Tea Tree, Avocado, Ginseng, Cucumber, Charcoal\r\nMade In Korea, Paraben Free, Oil Free, Sulfate Free, Cruelty-Free\r\nA deeply-hydrating, revitalizing skin therapy helps create firmer, healthier, more balanced skin\r\nFor dry, oily, or sensitive skin\"', '', '', '', '', '', '', '2025-04-18 08:54:41', '2025-04-18 08:54:41'),
(651, 271, 'Modules\\Product\\Entities\\Product', 'NIVEA Cocoa Butter Body Cream – Deep Nourishing for Dry Skin, 16 oz Jar', 'NIVEA Cocoa Butter Body Cream – Deep Nourishing for Dry Skin, 16 oz Jar', '\"About this item\r\nCarefully Selected Ingredients: Infused with our Deep Nourishing Serum, Cocoa Butter and Vitamin E\r\nDeep Nourishing: This NIVEA body cream nourishes dry skin for visible radiance\r\nMulti-Use: Creamy formula for dry skin is also perfect as a hand cream or a moisturizing foot cream\r\nGreat for Dry Skin: Body cream for dry skin leaves skin intensively hydrated, and radiant after just 1 application\"', '', '', '', '', '', '', '2025-04-18 08:57:28', '2025-04-18 08:57:28'),
(652, 272, 'Modules\\Product\\Entities\\Product', 'Acne Spot Treatment Cream – 10% Azelaic Acid for Cystic & Hormonal Breakouts, 1.8 oz', 'Acne Spot Treatment Cream – 10% Azelaic Acid for Cystic & Hormonal Breakouts, 1.8 oz', '\"About this item\r\nAnti-Acne Powerhouse：Clinically proven with 10% Azelaic Acid + 2% Salicylic Acid to reduce cystic acne swelling by 73%* overnight while unclogging pores. Dermatologist-tested for stubborn hormonal breakouts in teens & adults (13-30), this deep-penetrating formula targets acne on face, back, chest, and body without over-drying skin layers.\r\nScar-Fading Complex: Non-comedogenic Niacinamide & Tea Tree Oil visibly fade post-acne marks in 14 days* while calming redness. The environmental-shield formula protects sensitive skin during school/sports/commuting, preventing new breakouts in classrooms, gyms, and workplaces.\r\nRduce Cystic pimples: Relief active cystic pimples while gradually releasing tea tree antioxidants over 8 hours. 72% of users report reduced midday shine* through sebum-control matrix that targets root causes of teen/adult acne.\r\nFast-Absorbing Defense: Ultra-lightweight gel-cream absorbs in 20 seconds (89% trial-proven*) without pilling under makeup/SPF. pH-balanced (5.2-5.8) for daily use on face, bacne areas, and mask-prone zones, maintaining moisture during workouts/humidity.\r\nHygienic Protection System: To maintain ingredient potency & prevent contamination. Cruelty-free & compliant, this travel-friendly 1.8oz bottle for consistent treatment from dorm rooms to business trips.\r\n\"', '', '', '', '', '', '', '2025-04-18 09:00:33', '2025-04-18 09:00:33'),
(653, 273, 'Modules\\Product\\Entities\\Product', 'Medicube Collagen Overnight Mask – Hydration & Elasticity Care for Glowing Skin, 2.53 fl oz', 'Medicube Collagen Overnight Mask – Hydration & Elasticity Care for Glowing Skin, 2.53 fl oz', '\"About this item\r\nAwaken Your Glow with Overnight Elasticity Booster - Protect and enhance your skin\'s elasticity with our collagen wrapping film, delivering 8 hours of intensive care while you sleep. Perfect for waking up with firmer, more resilient skin.\r\nComes Off in One Piece -Just like there\'s no better feeling than a clean shed, this easy-to-peel mask leaves your face feeling fresh and clean.\r\nTo avoid confusion, the tube is filled to 80% capacity for safety and secure transport, while the product itself \"\"contains the standard 2.53 fl. oz.\"\"\r\nPowerful Ingredients: Ceramide NP for skin barrier and hydration, Collagen Extract for elasticity and youthful complexion, and Adenosine for reducing fine lines through skin renewal\r\nProven Results - Clinical trials show significant improvements with Medicube Collagen Night Wrapping Mask: +31.4% skin elasticity, +24.8% 24-hour moisture retention, and +23.4% skin surface hydration after 2 weeks of use. Individual results may vary.\"', '', '', '', '', '', '', '2025-04-18 09:05:24', '2025-04-18 09:05:24');
