(655, 275, 'Modules\\Product\\Entities\\Product', 'Slim RFID Money Belt – Minimalist Travel Pouch for Men & Women (Black)', 'Slim RFID Money Belt – Minimalist Travel Pouch for Men & Women (Black)', '\"LIFETIME REPLACEMENT GUARANTEE - Every VENTURE 4TH Money Belt is tested before shipping and backed by a lifetime guarantee. If anything goes wrong, we’ll replace it for free!\r\nRFID BLOCKING - Protects credit cards and personal data from identity theft and illegal scanning with advanced RFID technology.\r\nSLIM & SECURE - Discreet under clothing, this lightweight money belt keeps valuables safe from pickpockets while offering soft, all-day comfort.\r\nSPACIOUS DESIGN - Fits cash, cards, passports, tickets, and all phone sizes, including iPhone 16 Pro Max, keeping essentials secure and organized.\r\nDURABLE & ADJUSTABLE - Fits up to a 56\"\" waist with a fully adjustable strap. Made from waterproof 210D ripstop nylon with reinforced seams and secure zippers for lasting reliability.\"', '', '', '', '', '', '', '2025-04-18 09:22:48', '2025-04-18 09:22:48'),
