INSERT INTO `pages` (`id`, `title`, `slug`, `meta_tags`, `meta_description`, `content`, `status`, `visibility`, `page_builder_status`, `navbar_category_dropdown_open`, `created_at`, `updated_at`, `navbar_variant`, `breadcrumb_status`, `page_container_option`) VALUES
(1, 'Terms & Conditions', 'terms-and-conditions', 'terms,conditions', 'Sombokchab - Terms & Conditions', '&nbsp;&nbsp;&nbsp; Introduction and Acceptance of Terms<br><br>Welcome to the Sombokchab.com Platform! By registering, accessing, or using our platform, you agree to be bound by these Terms and Conditions, forming a legally binding contract. You must be of legal age and capacity under applicable law to use our services, as transactions are prohibited for minors as defined by law. If you do not agree to these terms, please refrain from accessing or using our Transaction Services. You have the option to terminate this contract by closing your account.<br><br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; Transaction Services Overview<br><br>Sombokchab.com provides an online transaction platform, referred to as “Transaction Services,” accessible through the Sites. Through these services, members can conduct online transactions for products or services available on the Sites. This includes activities such as placing orders, making payments, and receiving order fulfillment, all of which are governed by the terms outlined in this Contract.<br><br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; General Rules<br><br>(a) Participation binds you to these Official Rules.<br><br>(b) Fraud/abuse results in forfeiture of eligibility.<br><br>(c) Sombokchab.com is not responsible for late, lost, or misdirected entries.<br><br>(d) Eligibility is at Sombokchab’s discretion, and their records prevail in case of discrepancies.<br><br>(e) Sombokchab.com may amend these rules without notice.<br><br>(f) Sombokchab.com may cancel participation rights at its discretion.<br><br>4.User Accounts<br><br>&nbsp;&nbsp;&nbsp; To access certain features, users must create an account.<br>&nbsp;&nbsp;&nbsp; Users are responsible for maintaining the confidentiality of their account credentials.<br>&nbsp;&nbsp;&nbsp; Users must provide accurate and complete information during the registration process.<br><br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; Privacy Policy<br><br>4.1 Collection of Information for Transaction Services<br><br>By using Sombokchab.com Transaction Services, you acknowledge that your personal data, including personal details, credit information, business information, and financial information (collectively, “Collected Information”), will be accessed and processed by Sombokchab.com. This processing is necessary for the administration, processing, and operation of your use of Transaction Services, based on the contractual relationship between us and fulfilling obligations outlined in this Contract. Sombokchab.com will handle the Collected Information as per the Privacy Policy and personal information collection statement agreed upon during your application for and use of Transaction Services.<br><br>4.2. Use of Personal Data<br><br>We collect and use your personal information for the following purposes:<br><br>&nbsp;&nbsp;&nbsp; Verifying Platform account registrations, including fraud, security, “Know Your Customer,” and anti-money laundering checks for Seller account approval.<br>&nbsp;&nbsp;&nbsp; Verifying eligibility as a Platform blogger or influencer.<br>&nbsp;&nbsp;&nbsp; Setting up/administering Buyer and Seller accounts, providing log-in IDs, and establishing payment/transaction accounts.<br>&nbsp;&nbsp;&nbsp; Providing customer service support, responding to queries, feedback, and managing claims/dispute.<br>&nbsp;&nbsp;&nbsp; Supporting general Platform services, facilitating communication between Buyers and Sellers, processing transactions and payments, assessing advance withdrawal requests from Sellers, and providing logistics and delivery services.<br>&nbsp;&nbsp;&nbsp; Supporting Buyer and/or Seller clearance declarations/applications made via the Platform.<br>&nbsp;&nbsp;&nbsp; Offering membership benefits, including birthday rewards, membership offers, coupons, and anniversary awards.<br>&nbsp;&nbsp;&nbsp; Verifying identity and purchases for product warranty or other after-sales claims.<br>&nbsp;&nbsp;&nbsp; Assessing and monitoring account security and transaction risks, detecting and preventing fraud, money laundering, and other security incidents.<br>&nbsp;&nbsp;&nbsp; Sending tailored marketing and advertising based on your Platform usage, browsing records, and order history.<br>&nbsp;&nbsp;&nbsp; Conducting research and analytics to ensure Platform security, improve content/layout, and enhance product offerings and services.<br>&nbsp;&nbsp;&nbsp; Helping you find people you may know on Sombokchab.com<br><br>We may also use your personal information for other compatible purposes permitted by applicable data protection laws. Further information on compatibility with other purposes is available upon request.<br><br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; Data Security and Classification<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We employ necessary measures to prevent unauthorized access, maintain data accuracy, and ensure proper information use on the Site. In case of a data breach, we will notify you and regulatory authorities as per applicable data protection laws.<br><br>For registered Platform users, account information can be managed through a password-protected account. It’s your responsibility to keep the password secure. Avoid sharing it, and never disclose it to anyone. If using a shared computer, refrain from saving log-in details. Sign out and close your browser for added security.<br><br>While we employ security measures, perfect internet or wireless data transmission security cannot be guaranteed. We strive to protect your information but cannot ensure security for data transmitted over the internet.<br>5.2. Data Classification and Protection<br><br>All data will be classified into three categories—Highly Sensitive, Sensitive, and Public—based on its criticality and sensitivity. Each classification level will have corresponding protection measures to ensure the highest level of data security.<br><br>(a) Highly Sensitive Data<br><br>This category includes information critical to the organization’s operations and reputation.<br><br>Access restricted to authorized personnel only.<br><br>Encryption enforced for data in transit and at rest.<br><br>Regular security assessments and audits conducted.<br><br>(b) Sensitive Data<br><br>Pertains to information requiring protection but not classified as highly sensitive.<br><br>Access limited to individuals with a legitimate business need.<br><br>Data encryption implemented for transmission and storage.<br><br>Regular monitoring and access reviews conducted.<br><br>(c) Public Data<br><br>Non-sensitive, publicly available information.<br><br>Accessible to all authorized personnel.<br><br>Basic access controls in place.<br><br>No encryption required.<br><br>&nbsp;&nbsp;&nbsp; Disclosure of Personal Information<br><br>We share your personal information with:<br><br>&nbsp;&nbsp;&nbsp; Third-party partners and service providers assisting us.<br>&nbsp;&nbsp;&nbsp; Business and marketing partners based on your consent.<br>&nbsp;&nbsp;&nbsp; Payment service providers for payment processing.<br>&nbsp;&nbsp;&nbsp; Credit risk assessment providers for Seller risk evaluation.<br>&nbsp;&nbsp;&nbsp; Logistics partners for delivery and warehousing services.<br>&nbsp;&nbsp;&nbsp; Cloud computing or hosting service providers.<br>&nbsp;&nbsp;&nbsp; Warranty service providers for product warranty services.<br>&nbsp;&nbsp;&nbsp; Customer service support providers for after-sale services.<br>&nbsp;&nbsp;&nbsp; Risk control service providers for account and transaction risk assessment.<br>&nbsp;&nbsp;&nbsp; Third-party rating/reviewing service providers for customer feedback.<br>&nbsp;&nbsp;&nbsp; Professional advisers, law enforcement, insurers, and government agencies to comply with laws or protect legal rights.<br>&nbsp;&nbsp;&nbsp; Potential buyers in connection with business transactions.<br>&nbsp;&nbsp;&nbsp; Any other person with your consent.<br><br>&nbsp;&nbsp;&nbsp; Retention<br><br>We keep your personal information as long as necessary for legitimate business needs, providing services, or as required by laws. When there’s no ongoing need, we’ll delete or anonymize it. If deletion isn’t immediate (e.g., backup archives), we’ll securely store and isolate it. Retention periods vary based on website usage and information provided. Registered member data may be retained longer to comply with laws or in dispute situations.<br><br>&nbsp;&nbsp;&nbsp; Minors<br><br>The Platform is intended for adults, and users must be over 18 to use our services. We do not sell any products or services to minors, as defined by applicable law. If a minor has provided us with personal information without parental or guardian consent, we encourage the parent or guardian to contact us at [info@sombokchab.com] to request the removal of the information.<br><br>&nbsp;&nbsp;&nbsp; Prohibited Uses<br><br>Sombokchab strictly prohibits illegal content, false or misleading information, or infringement of rights on our site. Automated and human moderation tools ensure compliance, and we reserve the right to take measures affecting your service use.<br><br>Non-compliance may result in:<br><br>&nbsp;&nbsp;&nbsp; Request for additional information or verification.<br>&nbsp;&nbsp;&nbsp; Blocking or deleting your content.<br>&nbsp;&nbsp;&nbsp; Suspending your right to report content.<br>&nbsp;&nbsp;&nbsp; Freezing your publishing rights.<br>&nbsp;&nbsp;&nbsp; Suspending or canceling any transaction.<br>&nbsp;&nbsp;&nbsp; Suspending or terminating your account.<br><br>&nbsp;&nbsp;&nbsp; Selling Practices Policy<br>&nbsp;&nbsp;&nbsp; Meeting or exceeding customer’s expectations contributes to buyer satisfaction and successful transactions. To ensure a positive buyer experience and a seamless transaction, adhere to the following guidelines:<br><br>&nbsp;&nbsp;&nbsp; Provide accurate and consistent item details.<br>&nbsp;&nbsp;&nbsp; Clearly outline terms and conditions.<br>&nbsp;&nbsp;&nbsp; Offer reasonable shipping and handling costs.<br>&nbsp;&nbsp;&nbsp; Specify handling time and return policy.<br>&nbsp;&nbsp;&nbsp; Respond promptly to buyer inquiries.<br>&nbsp;&nbsp;&nbsp; Maintain professionalism throughout the transaction.<br>&nbsp;&nbsp;&nbsp; Ensure items are delivered as described.<br>&nbsp;&nbsp;&nbsp; Regularly review and update listings for accuracy.<br><br>&nbsp;&nbsp;&nbsp; Vendor and Third-Party Policy<br><br>By engaging as a vendor or third party on the platform, you agree to comply with all local laws, industry standards, and platform guidelines. This includes providing accurate product representations, maintaining quality standards, fulfilling orders promptly, transparently communicating with customers, adhering to the platform’s return and refund policies, respecting intellectual property rights, ensuring non-discrimination, upholding privacy and data security standards, and acknowledging that the platform reserves the right to terminate partnerships for policy violations or failure to meet legal requirements.<br><br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; Shipping Policy<br>&nbsp;&nbsp;&nbsp; Sellers are required to ship items within the specified handling time using the buyer-selected shipping service. They must accurately communicate shipment timelines, review delivery costs, and provide precise tracking details. Sellers should only charge actual shipping costs, inclusive of packaging and handling, and must not opt for slower services than selected by the buyer. No supplementary fees for handling are permissible when offering free shipping, and shipments must not be delayed once a payout is initiated. The following are the available shipping options to choose from:<br><br>1) Express Shipping:<br>Phnom Penh City: 1-2 hours<br><br>Province: 1-2 business days<br>Note: Cut-off time is from 8:00 AM to 4:00 PM.<br><br>2) Same-Day Shipping:<br>Phnom Penh City: 1 day<br><br>Province: 2-4 business days<br><br>Note: Cut-off time is from 8:00 AM to 12:00 PM. Therefore, any orders received after this hour will be delivered the next day.<br><br>3) Next Day Shipping:<br><br>Phnom Penh City: 2 business days<br><br>Province: 3-5 business days<br><br>4) Scheduled Shipping: Provide options of specific date and time for delivery that best fits to customer schedule.<br><br>&nbsp;&nbsp;&nbsp; Product Listings<br><br>13.1. Sellers are responsible for the accuracy of product listings, including descriptions, prices, and stock availability. The platform reserves the right to approve or reject listings.<br><br>13.2. Buyers must carefully review product details before making a purchase.<br><br>13.3. You may not post or sell any item that is restricted or prohibited by law. The www.sombokchab.com website operates as a domestic marketplace, and the selling or posting of items may be restricted due to laws in Cambodia. While we have provided some categories of prohibited or restricted items below, you, as the seller, are responsible for ensuring compliance with the laws of any jurisdiction. Lists of restricted or prohibited by law but are nonetheless controversial. These include:<br><br>(a) Items that encourage illegal activities (e.g., lock pick tools, drug paraphernalia, Unlawful surveillance equipment);<br><br>(b) Items that are racially, religiously, or ethnically derogatory, or that promote hatred, violence, racial, or religious intolerance;<br><br>(c) Lotteries or raffles;<br><br>(d) Stocks, bonds, investment interests, and other securities;<br><br>(e) Pornographic materials or items that are sexual in nature;<br><br>(f) Items that do not offer a physical product for sale, such as electronic books and other digital goods;<br><br>(h) Stolen property;<br><br>(i) Hazardous materials;<br><br>(j) Tobacco products and alcohol;<br><br>(k) Wildlife and animals/pets;<br><br>(l) Weapons<br><br>13.4. Sombokchab.com, in its sole and exclusive discretion, reserves the right to impose additional restrictions and prohibitions.<br><br>&nbsp;&nbsp;&nbsp; Payment and Fees<br><br>14.1. Transaction fees apply for completed product transactions. The fee is 10% of the total transaction amount.<br><br>14.2. Premium features, such as featured product listings, may incur additional fees.<br><br>14.3. Payments are processed securely through our designated payment gateway.<br><br>&nbsp;&nbsp;&nbsp; Product Cancellation and Refund Policy<br><br>15.1. Buyers may cancel an express order within 5 minutes of placing it, provided the seller has not yet shipped the item.<br>Note: Add cancellation notifications for the vendor to ensure compliance with the 5-minute cancellation policy for buyers, along with refund notifications.<br>15.2. Sellers may cancel an order if the item is out of stock or for other valid reasons. Buyers will be promptly notified, and any payments made will be refunded.<br><br>15.3. Eligibility for Product Returns: To be eligible for a product return, the following conditions must be met:<br><br>(a) The product must be unused and in the same condition as received.<br><br>(b) The product must be in its original packaging.<br><br>(c) Certain products, such as perishables, custom-made items, and devices, may not be eligible for return unless they are received in a damaged or defective condition.<br><br>&nbsp;&nbsp;&nbsp; Initiation of Product Returns<br><br>16.1. Buyers must initiate a product return within three (3) days of receiving the item.<br><br>16.2. To initiate a return, buyers should contact the seller directly through the order page on Sombokchab.com. Clear details and supporting evidence should be provided.<br><br>&nbsp;&nbsp;&nbsp; Product Returns Process:<br><br>17.1. Sellers are responsible for providing return shipping labels for products eligible for return due to damage, defect, or an error on the part of the seller.<br><br>17.2. Buyers are responsible for return shipping costs for products being returned for reasons other than damage, defect, or an error on the part of the seller.<br><br>&nbsp;&nbsp;&nbsp; Refund Process for Product Returns<br><br>18.1. Upon receiving and inspecting the returned product, the seller will notify the buyer of the approval or rejection of the refund.<br><br>18.2. If approved, the refund will be processed, and a credit will be applied to the original method of payment within 3-5 working days.<br><br>&nbsp;&nbsp;&nbsp; Damaged or Defective Products<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If a product arrives damaged or defective, buyers should contact the seller immediately with supporting evidence, such as clear photos of the damaged or defective product.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The seller will work with the buyer to provide a replacement or issue a refund based on the circumstances.<br><br>&nbsp;&nbsp;&nbsp; Payment Refund Policy <br><br>Circumstances for Refunds: Amounts paid through the Sokbokchab.com E-commerce payment gateway will only be refunded in the following circumstances:<br><br>&nbsp;<br><br>(a) Multiple Debiting due to Technical Error<br><br>&nbsp;&nbsp;&nbsp; If the customer’s account is debited multiple times due to a technical error, the excess amount (excluding Payment Gateway charges) will be refunded.<br><br>(b) Unsuccessful Delivery due to Technical Error<br><br>&nbsp;&nbsp;&nbsp; If a payment is charged on the customer’s card/bank account, but the delivery of an item is unsuccessful due to technical error, the customer can seek a refund. The refund will be the net amount after deducting Payment Gateway charges or any other applicable charges.<br><br>&nbsp;&nbsp;&nbsp; Refund Application Process<br><br>Customers must submit a refund application along with the transaction number and the original payment receipt (if generated) at the time of payment. For refund requests, please click [here-link].<br><br>Refund Request Form<br><br>Please fill out the form with accurate details and attach the original payment receipt if available. Upon submission, our team will review your request and process the refund accordingly.<br><br>Customer Name: ___________________________<br><br>Order ID<br><br>Customer Contact Number: ___________________________<br><br>Transaction Number: ___________________________<br><br>Date of Transaction: ___________________________<br><br>Reason for Refund: ___________________________<br><br>Description of Issue: ___________________________<br><br>Amount Paid: ___________________________<br><br>Method of Payment: ___________________________<br><br>Bank Account Details for Refund (if applicable):<br><br>Bank Name: ___________________________<br><br>Account Holder Name: ___________________________<br><br>Account Number: ___________________________<br><br>Branch (if applicable): ___________________________<br><br>Attach Original Payment Receipt (if generated): [Upload File]<br><br>Date of Refund Request: ___________________________<br><br>Customer Signature: ___________________________<br><br>[Submit] [Reset]<br><br>&nbsp;&nbsp;&nbsp; Manual Processing and Refund Timeframe<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Refunds will be processed manually by Sombokchab.com.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; After verification, if the refund claim is found valid, the excess amount will be refunded through electronic mode of payment within a period of 2 business days. It may take 1-2 days for the refunded amount to reflect in the customer’s bank account, depending on the bank’s policy.<br><br>&nbsp;&nbsp;&nbsp; Circumstances Beyond Control<br><br>23.1. Sombokchab.com assumes no responsibility and incurs no liability if it is unable to process any Payment Instruction(s) due to circumstances beyond its control, including but not limited to:<br><br>(a) Incomplete, inaccurate, or invalid Payment Instruction(s) issued by the Payment Gateway Service Provider.<br><br>(b) Funds in the Payment Account being under encumbrance or charge.<br><br>(c) Refusal or delay by the bank in honoring the Payment Instruction(s).<br><br>&nbsp;&nbsp;&nbsp; Limitation of Liability<br><br>24.1. Sombokchab.com shall not be liable for any direct, indirect, incidental, or consequential damages resulting from the use of our platform.<br><br>&nbsp;&nbsp;&nbsp; Termination<br><br>25.1. Sombokchab.com reserves the right to terminate or suspend user accounts if they violate the terms and conditions outlined in this agreement. Violations may include, but are not limited to:<br><br>&nbsp;&nbsp;&nbsp; Breach of any material provision of this agreement, including failure to comply with the acceptable use policy or other policies outlined by Sombokchab.com.<br>&nbsp;&nbsp;&nbsp; Engaging in fraudulent activities, unauthorized use of the platform, or any illegal activities.<br>&nbsp;&nbsp;&nbsp; Providing false or misleading information during the registration process or while using the platform.<br>&nbsp;&nbsp;&nbsp; Violating the intellectual property rights of Sombokchab.com or any third party.<br>&nbsp;&nbsp;&nbsp; Engaging in any conduct that may harm the reputation, security, or integrity of Sombokchab.com or its users.<br>&nbsp;&nbsp;&nbsp; Any other actions deemed inappropriate or harmful by Sombokchab.com in its sole discretion.<br><br>25.2. In the event of termination or suspension:<br><br>&nbsp;&nbsp;&nbsp; com may immediately deactivate or suspend the user’s account and access to the platform.<br>&nbsp;&nbsp;&nbsp; Any fees or charges owed to Sombokchab.com become immediately due and payable.<br>&nbsp;&nbsp;&nbsp; com may take legal action or seek other remedies as appropriate.<br>&nbsp;&nbsp;&nbsp; The user may lose access to any data, content, or information associated with their account.<br><br>25.3. Sombokchab.com will endeavor to provide prior notice of termination or suspension, except in cases of emergency or where immediate action is necessary to protect the interests of Sombokchab.com or its users.<br><br>&nbsp;&nbsp;&nbsp; Dispute Resolution and Governing Law<br><br>In the event of a disagreement between users and Sombokchab.com, both parties agree to seek resolution through mediation before pursuing legal proceedings in a competent court in Cambodia.<br><br>&nbsp;&nbsp;&nbsp; Terms and Conditions: Buyer Protection Money Back Guarantee<br><br>These Terms &amp; Conditions pertain to the “Buyer Protection Money Back Guarantee” or “Basic Buyer Protection” on Sombokchab.com (referred to as the “Buyer Protection”).<br><br>27.1. Eligible Member<br><br>To qualify, you must be a registered member of Sombokchab.com with a valid account and have successfully completed a purchase on the platform.<br><br>27.2. Buyer Protection Period<br><br>The duration, visible at the time of purchase, starts when an Eligible Member completes a purchase on Sombokchab.com<br><br>27.3. Rules<br><br>(a) If an eligible member does not receive goods/services within the Buyer Protection Period or receives sub-standard items, a dispute can be initiated via email at info@sombokchab.com.<br><br>(b) Sombokchab.com will investigate, considering factors such as damaged, defective, or misrepresented items, non-arrival reasons, and relevant evidence provided by the Eligible Member.<br><br>(c) Sombokchab.com may request information to support the claim.<br><br>(d) After Dispute Procedures, a final determination will be made. If in favor of the Eligible Member, a refund will be processed within 30 days.<br><br>&nbsp;&nbsp;&nbsp; Cookies Understanding, Purposes and Control<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; This section provides information on the use of cookies and similar technologies on our Platform. Cookies are strings of information stored on your device, notifying our servers of your visit and usage patterns. First-party cookies are set by Sombokchab.com while third-party cookies enable additional features. They can be session-based (erased after closing the browser) or persistent.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Purposes<br><br>&nbsp;&nbsp;&nbsp; Essential Cookies: Necessary for technical and security reasons, enabling basic functionality like remembering items in your shopping basket.<br>&nbsp;&nbsp;&nbsp; Web Analytics: First-party cookies aid in understanding user behavior for improving web pages and functionality.<br>&nbsp;&nbsp;&nbsp; Social Media Cookies: Used when sharing content on platforms like Facebook and Twitter, each governed by its own privacy policy.<br><br>Interest-Based Advertising: Cookies track visitor interests, enhancing the user experience, supporting partner tracking, and assessing the success of promotions and email marketing.<br><br>&nbsp;&nbsp;&nbsp; Control<br><br>Users have the right to control cookies, either accepting or declining them through browser settings.<br><br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; Members Responsibility<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Every Member affirms, guarantees, and consents to the following: (a) possessing the full authority to accept the Terms, to provide the necessary licenses and authorizations, and to fulfill the obligations outlined herein; (b) utilizing the Sites and Services exclusively for business-related activities; and (c) if a Member represents a business entity, ensuring that the address provided during registration serves as the primary location of said business entity. Additionally, for business entities, any branch or liaison office will not be treated as a distinct entity, and the principal place of business will be considered that of the head office.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Members must provide accurate and complete information about their entity, business, or products/services during registration and ensure that it remains up-to-date throughout their use of the Sites or Service.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Members understand and accept that Sombokchab.com has the right, but is not obligated, to monitor or control the content of messages, materials, or information accessed through the Services or Sites. Sombokchab.com does not endorse, verify, or certify the contents of any user-generated content. Each Member is solely responsible for their communications and may be legally liable for their content.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Each Member agrees to:<br><br>&nbsp;&nbsp;&nbsp; Abide by all applicable laws and regulations while using the Sites;<br>&nbsp;&nbsp;&nbsp; Conduct business transactions with other users in a fair and honest manner;<br>&nbsp;&nbsp;&nbsp; Comply with the Terms and any additional agreements;<br>&nbsp;&nbsp;&nbsp; Refrain from using the Services for fraudulent activities, such as selling stolen items or using stolen payment cards;<br>&nbsp;&nbsp;&nbsp; Avoid impersonating others or misrepresenting affiliations;<br>&nbsp;&nbsp;&nbsp; Refrain from spamming or engaging in phishing activities;<br>&nbsp;&nbsp;&nbsp; Avoid any unlawful activities and refrain from encouraging such behavior;<br>&nbsp;&nbsp;&nbsp; Not attempt to copy, reproduce, or exploit Sombokchab.com’s proprietary directories, databases, or listings;<br>&nbsp;&nbsp;&nbsp; Refrain from distributing computer viruses or other harmful software;<br>&nbsp;&nbsp;&nbsp; Not attempt to undermine the integrity of Sombokchab.com’s data, systems, or networks;<br>&nbsp;&nbsp;&nbsp; Ensure that neither you nor your affiliates are subject to economic or fraud sanctions;<br>&nbsp;&nbsp;&nbsp; Refrain from engaging in any activities that could create liability for Sombokchab.com or its affiliates.', 'publish', 'all', 0, 0, '2021-11-15 06:44:29', '2024-12-15 23:17:58', '3', '1', '0'),
(2, 'Privacy Policy', 'privacy-policy', 'privacy, policy', 'Safecart Privacy Policy Page', '<b><span style=\"font-size: 36px;\">Privacy Policy</span></b><br><br>Effective Date: [14-Jan-2025]<br><br>Sombokchab (“we,” “our,” or “us”) values your privacy and is committed to protecting your personal data. This Privacy Policy explains how we collect, use, disclose, and safeguard your information when you visit our website [insert website URL], use our mobile application, or access our services on the Sombokchab platform, a leading multivendor marketplace in Cambodia.<br><br>By accessing or using our platform, you agree to the terms of this Privacy Policy. If you do not agree, please refrain from using our services.<br><b><span style=\"font-size: 18px;\">1. Information We Collect</span></b><br><br>We collect personal and non-personal information to provide and improve our services. The types of information we collect include:<br><b>a. Personal Information</b><br><br>&nbsp;&nbsp;&nbsp; Account Information: Name, email address, phone number, address, and account credentials when you register as a buyer or vendor.<br>&nbsp;&nbsp;&nbsp; Payment Information: Payment card details, bank account information, or mobile wallet details for processing transactions.<br>&nbsp;&nbsp;&nbsp; Identification Data: National ID, passport, or other documents required for vendor verification.<br><br><b>b. Non-Personal Information</b><br><br>&nbsp;&nbsp;&nbsp; Usage Data: IP address, browser type, operating system, and browsing behavior on our platform.<br>&nbsp;&nbsp;&nbsp; Device Information: Device type, unique device identifiers, and mobile network information.<br>&nbsp;&nbsp;&nbsp; Cookies and Tracking Data: Information from cookies, web beacons, and similar technologies.<br><br><span style=\"font-size: 18px;\"><b>2. How We Use Your Information</b></span><br><br>We use the collected information for the following purposes:<br><br>&nbsp;&nbsp;&nbsp; Account Management: To register and manage your account as a buyer or vendor.<br>&nbsp;&nbsp;&nbsp; Transaction Processing: To facilitate purchases, sales, refunds, and payouts securely.<br>&nbsp;&nbsp;&nbsp; Customer Support: To respond to your inquiries, complaints, or requests for assistance.<br>&nbsp;&nbsp;&nbsp; Personalization: To tailor content, product recommendations, and marketing based on your preferences.<br>&nbsp;&nbsp;&nbsp; Security: To detect, prevent, and address fraud, unauthorized access, or other malicious activities.<br>&nbsp;&nbsp;&nbsp; Compliance: To meet legal obligations, such as tax reporting or regulatory compliance.<br><br><b><span style=\"font-size: 18px;\">3. Sharing Your Information</span></b><br><br>We do not sell your personal data. However, we may share your information in the following scenarios:<br><br>&nbsp;&nbsp;&nbsp; Vendors and Buyers: To facilitate transactions, your contact details (e.g., phone number and delivery address) may be shared between buyers and vendors.<br>&nbsp;&nbsp;&nbsp; Service Providers: Third-party vendors who assist with payment processing, logistics, marketing, or analytics.<br>&nbsp;&nbsp;&nbsp; Legal Authorities: When required by law or to protect our legal rights and interests.<br>&nbsp;&nbsp;&nbsp; Business Transfers: In the event of a merger, acquisition, or sale of assets, your information may be transferred to the new entity.<br><br><b><span style=\"font-size: 18px;\">4. Your Rights</span></b><br><br>As a user of Sombokchab, you have the following rights:<br><br>&nbsp;&nbsp;&nbsp; Access: Request access to your personal data and details about how it is processed.<br>&nbsp;&nbsp;&nbsp; Correction: Update or correct inaccurate or incomplete personal information.<br>&nbsp;&nbsp;&nbsp; Deletion: Request the deletion of your personal data, subject to legal or contractual obligations.<br>&nbsp;&nbsp;&nbsp; Objection: Opt-out of direct marketing or object to data processing based on legitimate interests.<br>&nbsp;&nbsp;&nbsp; Portability: Request a copy of your data in a structured, commonly used, and machine-readable format.<br><br><b><span style=\"font-size: 18px;\">5. Data Security</span></b><br><br>We implement robust technical and organizational measures to protect your data from unauthorized access, loss, or misuse. However, no system can guarantee absolute security. We encourage you to use strong passwords and to notify us of any suspicious activity on your account.<br><b><span style=\"font-size: 18px;\">6. Cookies and Tracking Technologies</span></b><br><br>We use cookies and similar technologies to:<br><br>&nbsp;&nbsp;&nbsp; Enhance the user experience.<br>&nbsp;&nbsp;&nbsp; Remember your preferences and login details.<br>&nbsp;&nbsp;&nbsp; Analyze website traffic and performance.<br><br>You can manage your cookie preferences through your browser settings.<br><b><span style=\"font-size: 18px;\">7. Third-Party Services</span></b><br><br>Our platform may contain links to third-party websites or services. We are not responsible for the privacy practices of these external sites. We recommend reviewing their privacy policies before sharing any information.<br><b><span style=\"font-size: 18px;\">8. Children’s Privacy</span></b><br><br>Sombokchab does not knowingly collect personal data from individuals under 13 years old. If we discover that we have inadvertently collected such data, we will delete it promptly.<br><b><span style=\"font-size: 18px;\">9. Changes to This Privacy Policy</span></b><br><br>We may update this Privacy Policy from time to time to reflect changes in our practices or legal obligations. We encourage you to review this page periodically for updates. The \"Effective Date\" at the top indicates when the policy was last revised.<br><b><span style=\"font-size: 18px;\">10. Contact Us</span></b><br><br>If you have any questions or concerns about this Privacy Policy or our data practices, please contact us at:<br><b><br>Sombokchab Support</b><br>Email: info@sombokchab.com<br>Phone: [ +855 69 503 999 ]<br>Address: [ #20, St. 598C, Phum Tomnub, Sangkat Phnom Penh Thmey, Khan Sensok, Phnom Penh, Cambodia ]<br><br>By using Sombokchab, you acknowledge that you have read and understood this Privacy Policy. Thank you for trusting us with your data as we continue to enhance Cambodia’s multivendor marketplace experience.', 'publish', 'all', 0, 0, '2021-11-16 05:16:13', '2025-01-13 20:00:51', '3', '1', '0'),
