INSERT INTO `products` (`id`, `name`, `slug`, `summary`, `description`, `image_id`, `price`, `sale_price`, `cost`, `badge_id`, `brand_id`, `status_id`, `product_type`, `sold_count`, `min_purchase`, `max_purchase`, `is_refundable`, `is_in_house`, `is_inventory_warn_able`, `created_at`, `updated_at`, `deleted_at`, `admin_id`, `vendor_id`, `is_taxable`, `tax_class_id`, `product_status`) VALUES
(203, 'Newborn Baby Girl Clothes, Infant Girl Outfits Long Sleeve Ruffle Romper + Floral Pants + Headband Set', 'newborn-baby-girl-clothes-infant-girl-outfits-long-sleeve-ruffle-romper-floral-pants-headband-set', 'Adorably stylish and comfortable, this 3-piece baby girl outfit set includes a soft cotton long-sleeve ruffled romper, floral or leopard-print pants, and a matching headband. Perfect for daily wear, photoshoots, or special occasions. Available in multiple colors and sizes from 0–12 months.', '\"About this item\r\n<div>MATERIAL: High quality cotton blend fabric baby girl outfits,soft and breathable, skin friendly for baby daily wear or outdoor wear.\r\n</div><div>DESIGN: Fashion design of infant girl clothes, ruffled newborn girl long-sleeved top with floral pants or leopard-print pants and cute headband decorations, such cute baby girls clothes come in a variety of colors, including yellow/pink/red/purple/beige baby girl clothes.\r\n</div><div>OCCASIONS: Baby girl fall outfits set, nice for photoshooting, dress up and holiday, suitable as infant girl home outfit, daily wear, play wear, great birthday gift.\r\n</div><div>SIZE: Suitable for 0-3 months baby girl clothes, 3-6 months infant girl outfits, 6-9 months newborn girls’clothing and 9-12 months toddler girl clothes.\r\n</div><div>PACKAGE:1PC Baby Girl Romper + 1PC Floral Pants + 1PC Headband.\"</div>', '1085', 25, 19.99, 10, 5, NULL, 1, 1, NULL, 1, 50, 0, 1, 2, '2025-04-09 22:39:42', '2025-04-16 16:55:54', '2025-04-16 16:55:54', 1, NULL, 0, NULL, 'publish'),
(204, 'Gerber Baby Boys 4 Pack Sleep \'N Play Footie', 'gerber-baby-boys-4-pack-sleep-n-play-footie', 'This 4-pack of Gerber long-sleeve Sleep \'n Plays features front zippers with safety tabs for quick and easy changes. Made for comfort during rest or play, these cozy outfits are machine washable and adorned with cute screenprint designs.', '\"About this item\r\n<div>Includes four (4) long-sleeve Gerber sleep n\' plays\r\n</div><div>Front zippers with safety tabs for easier changes\r\n</div><div>Keeps your baby comfortable as they rest or romp\r\n</div><div>Machine wash, tumble dry\r\n</div><div>Art details: Screenprint\"</div>', '1090', 31.19, 23.99, 12, 5, NULL, 1, 1, NULL, 1, 50, 0, 1, 2, '2025-04-09 22:44:37', '2025-04-16 16:55:54', '2025-04-16 16:55:54', 1, NULL, 0, NULL, 'publish'),
(205, 'Simple Joys by Carter\'s baby-girls 3-pack Snap-up Rompers', 'simple-joys-by-carters-baby-girls-3-pack-snap-up-rompers', 'This 3-pack of baby girl short-style rompers features fun prints, vibrant colors, and adorable characters. Designed with snap-up closures for easy changes and made from OEKO-TEX certified materials, these rompers are perfect for warm weather and everyday comfort.', '\"About this item<div>Pack of 3: Three baby girl rompers, offering great variety and convenience, perfect for everyday wear or as a gift.</div><div>Fun Prints &amp; Patterns: Adorable and playful designs, including vibrant colors, cute animal characters, florals, and more to brighten up your little one\'s wardrobe.</div><div>Snap-Up Closure: Full-length snaps from the neck to the legs make dressing and diaper changes quick and easy, allowing for hassle-free outfit swaps without pulling over the head.</div><div>Short-Style Rompers: Short-sleeve and short-leg design is ideal for warm weather, keeping your baby cool and offering freedom of movement.</div><div>OEKO-TEX Certified: Made from materials that meet the OEKO-TEX Standard 100, ensuring they are free from harmful chemicals and safe for delicate skin.</div><div>Product received may be manufactured in Cambodia, India, Thailand or Vietnam.\"</div>', '1094', 24.31, 18.7, 9.35, 5, NULL, 1, 1, NULL, 1, 50, 0, 1, 2, '2025-04-09 22:50:13', '2025-04-16 16:55:54', '2025-04-16 16:55:54', 1, NULL, 0, NULL, 'publish'),
(206, 'Hudson Baby Unisex Baby Plush Animal Face Bathrobe', 'hudson-baby-unisex-baby-plush-animal-face-bathrobe', 'Keep your baby cozy and adorable with this animal face hooded bath robe, made from 100% plush coral fleece. Soft, gentle, and perfect for everyday use, it offers warmth, comfort, and great value.', '\"About this item\r\n<div>Animal face plush hooded bath robe\r\n</div><div>Made with 100% plush coral fleece fabric\r\n</div><div>Soft and gentle on baby\'s skin\r\n</div><div>Optimal for everyday use\r\n</div><div>Affordable, high quality bath robe\"</div>', '1096', 14.29, 10.99, 5.5, 5, NULL, 1, 1, NULL, 1, 50, 0, 1, 2, '2025-04-09 22:53:11', '2025-04-16 16:55:54', '2025-04-16 16:55:54', 1, NULL, 0, NULL, 'publish'),
(207, 'Burt\'s Bees Baby Boys\' Sleep & Play PJs, 100% Organic Cotton One-Piece Zip Front Jumpsuit, Baby Boys Footie Pajamas & PJs', 'burts-bees-baby-boys-sleep-play-pjs-100-organic-cotton-one-piece-zip-front-jumpsuit-baby-boys-footie-pajamas-pjs', 'Soft and breathable 100% organic cotton footie pajamas with diagonal zip for easy changes, non-slip grips, and convertible mitts. Ideal for newborn comfort.', '\"About this item\r\n<div>Organic Comfort: Wrap little bees with 100% organic cotton footie pajamas. These baby boy footies offer gentle softness for your newborn baby\'s delicate skin. These newborn essentials have a relaxed and roomy fit. Size: Preemie\r\n</div><div>Easy Diaper Changes: Featuring a diagonal zip front, these one-piece footies feature a hidden diagonal zipper and an interior zipper guard that makes late-night diaper changes a breeze.\r\n</div><div>Bee Grips: Each Burt\'s Bees Baby footie pajama has non-slip \"\"\"\"bee grip\"\"\"\" footies to provide stability for early movers, ensuring your little bee stays steady during playtime. Seasonally, we offer footless options for warm weather months.\r\n</div><div>Convertible Mitts: Newborn and 0-3 months sizes come with no-scratch convertible mittens to keep little one\'s hands toasty warm, and protect delicate skin from those tiny (but mighty!) newborn nails.\r\n</div><div>Soft and Certified Organic: It has breathable fabric designed for comfort throughout the day and night. The fabric is combed and ring-spun for added durability.\"</div>', '1102', 6.19, 4.76, 2.38, 5, NULL, 1, 1, NULL, 1, 50, 0, 1, 2, '2025-04-09 23:01:57', '2025-04-15 02:51:55', '2025-04-15 02:51:55', 1, NULL, 0, NULL, 'publish'),
(208, 'Onesies Brand unisex-baby 8-pack Short Sleeve Mix & Match Bodysuits', 'onesies-brand-unisex-baby-8-pack-short-sleeve-mix-match-bodysuits', 'Pack of 8 soft cotton bodysuits with leg snaps and lap-shoulder design for easy dressing. Adorable screenprint art makes it perfect for everyday wear.', '\"About this item\r\n<div>Includes 8 short sleeve Onesies bodysuits\r\n</div><div>Made from 100% cotton to be gentle on sensitive skin\r\n</div><div>Simple leg snaps for easy dressing and diaper changes\r\n</div><div>Expandable lap-shoulder neckline for easy removal\r\n</div><div>Screenprint text art and puff\"</div>', '1109', 28.59, 21.99, 11, NULL, NULL, 1, 1, NULL, 1, 50, 0, 0, 2, '2025-04-11 02:25:25', '2025-04-15 02:51:07', '2025-04-15 02:51:07', NULL, 245, 0, NULL, 'publish'),
(209, 'Onesies Brand unisex-baby 8-pack Short Sleeve Mix & Match Bodysuits', 'onesies-brand-unisex-baby-8-pack-short-sleeve-mix-match-bodysuits', 'Sombokchab.com Product Listing\r\n100%\r\nD8\r\n\r\nPack of 8 soft cotton bodysuits with leg snaps and lap-shoulder design for easy dressing. Adorable screenprint art makes it perfect for everyday wear.\r\n \r\n \r\nProduct List\r\n 	\r\nPack of 8 soft cotton bodysuits with leg snaps and lap-shoulder design for easy dressing. Adorable screenprint art makes it perfect for everyday wear.\r\nTurn on screen reader support\r\n \r\nTo enable screen reader support, press Ctrl+Alt+Z To learn about keyboard shortcuts, press Ctrl+slash', '\"About this item<div>Includes 8 short sleeve Onesies bodysuits</div><div>Made from 100% cotton to be gentle on sensitive skin</div><div>Simple leg snaps for easy dressing and diaper changes</div><div>Expandable lap-shoulder neckline for easy removal</div><div>Screenprint text art and puff\"</div>', '1110', 28.59, 21.99, 11, 2, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-15 07:42:04', '2025-04-15 07:58:50', '2025-04-15 07:58:50', NULL, 245, 0, NULL, 'publish'),
(210, 'SUNNY PIGGY Newborn Infant Baby Girl Clothes Ruffle Romper Toddler Girl Floral Cotton Pant Sets Girls Clothing Outfit', 'sunny-piggy-newborn-infant-baby-girl-clothes-ruffle-romper-toddler-girl-floral-cotton-pant-sets-girls-clothing-outfit', 'Stylish ruffle sleeve romper with floral pants and headbands. Made from soft cotton blend, perfect for all occasions and gifting.', '\"About this item\r\n<div>Materials: High Quality Cotton Blend Fabric. Super soft and comfortable for your little girl.\r\n</div><div>Design: Pretty ruffle sleeve romper top and floral pattern pant sets make your baby girl more adorable in all day. Cute letter printed is full of love.\r\n</div><div>Size: Baby girl clothes 0-3 months, 3-6 months baby girl clothes, 6-12 month newborn girl outfits, 12-18 months toddler girl Clothes.\r\n</div><div>Occasion: Fit for birthday gifts, weddings, baby shower, parties, photograph, school, park, holiday outfits, family days, play wear, indoor wear, fall,winter,spring, summer or any other occasion.\r\n</div><div>Package: 1* Romper Top, 1* Floral Pants, 2* Cute Headband.\"</div>', '1118', 19.47, 14.98, 7.49, NULL, NULL, 1, 1, NULL, 1, 50, 1, 0, 2, '2025-04-15 07:47:43', '2025-04-15 07:58:54', '2025-04-15 07:58:54', NULL, 245, 0, NULL, 'publish'),
