(223, 'W7 Sweet Dreams Lip Care Trio - 3 Piece Gift Set - Overnight Lip Mask, Lip Balm & Lip Scrub - Strawberry', 'w7-sweet-dreams-lip-care-trio-3-piece-gift-set-overnight-lip-mask-lip-balm-lip-scrub-strawberry', 'Treat your lips with the W7 Sweet Dreams Trio! This 3-piece set includes a strawberry lip scrub, lip balm, and overnight lip mask for smooth, soft, and hydrated lips—perfect for daily care or gifting.\"', '\"About this item\r\n<div>SWEET LIPS - A set of lip loving essentials featuring a jar of soft &amp; nourishing exfoliating sugar crystals that contain Vitamin E and Strawberry Extract, an overnight lip mask pot that contains aloe vera and grape seed oil and a glossy, nourishing lip balm! These formulas will moisturize and revive dry and chapped lips all year round! Strawberry flavored and scented for an uplifting, sweet aroma!\r\n</div><div>KISSABLE - These products contain skin-loving ingredients such as Vitamin E, Fruit Extracts and Shea Butter to revive, condition and support skin health. Make lips smoother, beautifully soft and more kissable with these juicy formulas.\r\n</div><div>HOW TO USE - Using your fingers, apply a small amount of the scrub to your lip area and gently massage in a circular motion and buff away any dead and dry skin. Simply wipe away the excess for newly conditioned lips. For the ultimate aftercare, apply a small amount of mask to the lips right before bed, letting it naturally absorb. Use our balm as and when required to condition lips for an even more perfect pout or for a full glossy finish.\r\n</div><div>PROFESSIONAL QUALITY - W7 Cosmetics are designed in London. All our skincare products are safe on sensitive skin and are fully tested. Not suitable for children.\r\n</div><div>CRUELTY FREE - W7 products are vegan-friendly &amp; 100% cruelty free. None of our products are tested on animals\"</div>', '1210', 12.94, 9.95, 4.98, NULL, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-15 09:51:18', '2025-04-15 09:51:18', NULL, NULL, 245, 0, NULL, 'publish'),
(224, 'Wonderskin Wonder Blading Lip Stain Peel Off Masque - Long Lasting, Waterproof and Transfer Proof Nude Lip Tint, Matte Finish Peel Off Lip Stain (Whimsical Masque)', 'wonderskin-wonder-blading-lip-stain-peel-off-masque-long-lasting-waterproof-and-transfer-proof-nude-lip-tint-matte-finish-peel-off-lip-stain-whimsical-masque', 'Get bold, smudge-proof color with Wonderskin’s Wonder Blading Lip Stain! This peel-off nude tint delivers a matte finish that’s waterproof, transfer-proof, and long-lasting—perfect for all-day wear in the shade Whimsical Masque.\"', '\"About this item\r\n<div>𝗧𝗛𝗘 𝗣𝗘𝗥𝗙𝗘𝗖𝗧 𝗟𝗢𝗡𝗚 𝗟𝗔𝗦𝗧𝗜𝗡𝗚 𝗟𝗜𝗣 𝗦𝗧𝗔𝗜𝗡 - Looking for a natural lip stain that can withstand anything? Look no further than Wonder Blading Lip Stains! Our liquid lip stain or lip liner stain is a long-lasting lip stain that is smudge-proof, transfer-proof, water-proof, and even mask-proof, making it the perfect choice for any daytime or nighttime plans. Embrace captivating shades, like our Whimsical, which features a delightful Warm Rose hue.\r\n</div><div>𝗣𝗔𝗧𝗘𝗡𝗧𝗘𝗗 𝗪𝗢𝗡𝗗𝗘𝗥 𝗕𝗟𝗔𝗗𝗜𝗡𝗚 𝗧𝗘𝗖𝗛𝗡𝗢𝗟𝗢𝗚𝗬 - Our viral blue lip masque is one of our most innovative products yet. Using our patent-pending Liquid Blading technology, our natural lip stain infuses colorants and pigments into the top layer of your lips, then seals them in to prevent feathering, fading, or budging for hours on end.\r\n</div><div>𝟭-𝗦𝗧𝗘𝗣 𝗦𝗧𝗔𝗜𝗡 &amp; 𝗚𝗢 - Achieving a low-maintenance, long-wear look has never been easier with our Lip Stain Masque. Apply the Lip Stain Masque and let it set for 10 - 30 seconds, then wipe away with a damp towel or tissue. You’ll be left with a natural lip stain that won’t budge or fade throughout the day, even when eating or drinking.\r\n</div><div>𝗖𝗢𝗠𝗣𝗔𝗥𝗜𝗡𝗚 𝗦𝗧𝗔𝗜𝗡 &amp; 𝗚𝗢 VS 𝗣𝗘𝗘𝗟 &amp; 𝗥𝗘𝗩𝗘𝗔𝗟 Kit :Stain &amp; Go is the 1-step, quick and easy, way to get long wear lip color that is transfer-free, feather proof and water resistant that will last for hours. Peel &amp; Reveal is a 2-step process which uses our Activator to deliver hyper-staining for enhanced lip color and advanced 10-hour wear which is transfer proof, water proof and budge proof.\r\n</div><div>𝗕𝗨𝗜𝗟𝗗𝗔𝗕𝗟𝗘 𝗟𝗜𝗣 𝗦𝗧𝗔𝗜𝗡: 𝗔𝗖𝗛𝗜𝗘𝗩𝗘 𝗔 𝗕𝗢𝗟𝗗 𝗙𝗜𝗡𝗜𝗦𝗛 - If you prefer a bolder finish, the Lip Stain Masque is buildable. Simply re-apply, let it set, and wipe away when you’re ready for an even more vibrant look. And when you’re ready to remove it at the end of the day, you can do this easily by using any oil based makeup remover.\"</div>', '1213', 28.6, 22, 11, NULL, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-15 10:03:51', '2025-04-15 10:03:51', NULL, NULL, 245, 0, NULL, 'publish'),
(225, '\"Makeup Brushes 22 Pcs Makeup Kit,Foundation Brush Eyeshadow Brush Make up Brushes Set (Green, 22 Piece Set) \"', 'makeup-brushes-22-pcs-makeup-kitfoundation-brush-eyeshadow-brush-make-up-brushes-set-green-22-piece-set', 'Complete your beauty routine with this 22-piece makeup brush set! Includes foundation, eyeshadow, and blending brushes—perfect for beginners and pros. Soft bristles, stylish green design, and flawless application every time.\"', '\"About this item\r\n<div>Koccido Makeup Brushes Set : We\'ve designed a comprehensive makeup combination kit that caters to diverse beauty requirements, enhancing the convenience of your makeup routine. Every beauty aficionado deserves to own a kit like this!\r\n</div><div>Comprehensive Makeup Brush Set : This set includes 13 makeup brushes and a storage bag. In addition, we also prepare a silicone face-pack brush, a sponge egg set, and two silicone lip brush, a brush cleaning egg, and a silicone facial cleansing brush. This set is a good choice for beauty lovers.\r\n</div><div>Soft and Comfortable Bristles : The bristles of our makeup brush set are made of high-quality fiber. The bristles are rich, soft and fluffy, and will not fall off easily. They can better grasp the powder and spread evenly on the face, which not only makes your makeup more natural, but also gentle and non-irritating to the skin.\r\n</div><div>Rugged Handle : The makeup brush set is made of sturdy materials, which will not break easily when used in daily life. The handle is designed to fit the palm of the hand and is ergonomically designed, and it will not fall easily when using it.\r\n</div><div>Multifunctional use : Each product in our makeup brush set is very practical. It can not only meet your makeup needs for eyes, cheeks, and lips, but also apply to a variety of cosmetics, including foundation, BB cream, powder, concealer, isolation liquid, and can be used for a long time.\"</div>', '1221', 10.39, 7.99, 4, NULL, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-15 10:08:55', '2025-04-15 10:08:55', NULL, NULL, 245, 0, NULL, 'publish'),
(226, 'Colourpop Going Coconuts Eyeshadow Palette - Cool-Toned Neutral Eyeshadow Palette with Ultra-Velvety and Silky Finishes - High-Pigment Eye Makeup with a Long-Wearing Formula (0.3 oz)', 'colourpop-going-coconuts-eyeshadow-palette-cool-toned-neutral-eyeshadow-palette-with-ultra-velvety-and-silky-finishes-high-pigment-eye-makeup-with-a-long-wearing-formula-03-oz', 'Create effortless everyday looks with ColourPop\'s Going Coconuts Palette! This cool-toned neutral eyeshadow set features ultra-velvety, high-pigment shades with silky finishes and a long-wearing formula.\"', '\"About this item\r\n<div>The Neutrals of Our Dreams - Go loco for this toasted neutral 9 pan palette, perfect for your every day look. This super wearable neutral eyeshadow palette is cute, compact, and ready for any natural makeup look.\r\n</div><div>Makeup That Lasts - The long wearing formula of our eyeshadow palettes contain a unique combination of softer powders which adheres easily to the eyes, gives a soft focus effect, and blends smoothly and evenly.\r\n</div><div>Bring On The Bold - Mix and match this cool toned eyeshadow palette with some of our more bold, metallic eyeshadows. This neutral palette is the perfect starting point for any look you want to achieve!\r\n</div><div>Application Tips - Apply with your favorite eyeshadow brushes. Flat and firmer brushes will give the most color payoff, while fluffier brushes are best for blending. Use a small angled brush to line the eyes.\r\n</div><div>With Love, From California - It\'s our mission to redefine luxury beauty by creating amazing products at prices that don\'t break the bank. We imagine, develop, test and manufacture all under one roof for next level colour + formulas. We pride ourselves on being 100% cruelty-free and keeping our community at the center of our world.\r\n\"</div>', '1230', 17.55, 13.5, 6.75, NULL, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-15 10:12:00', '2025-04-15 10:12:00', NULL, NULL, 245, 0, NULL, 'publish'),
