(238, 'French Toast Girls\' Ruffle Pique Polo Dress', 'french-toast-girls-ruffle-pique-polo-dress', 'French Toast Girls\' Ruffle Pique Polo Dress', '\"About this item\r\n<div>Cotton Blend Pique\r\n</div><div>50 Wash Tested Shrink &amp; Fade Resistant\r\n</div><div>Flat Knit Collar\r\n</div><div>Gathers At Sleeve Cap\r\n</div><div>Dropped Waist With Ruffled Hem\r\n</div><div>Pearlized Poly Button Placket\"</div>', '1266', 12.35, 9.5, 4.75, NULL, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-16 16:41:45', '2025-04-16 16:41:45', NULL, NULL, 249, 0, NULL, 'publish'),
(239, 'BeryLove Women Sequin Formal Party Dress Flutter Short Sleeve Wedding Cocktail Long Evening Dress', 'berylove-women-sequin-formal-party-dress-flutter-short-sleeve-wedding-cocktail-long-evening-dress', 'BeryLove Women Sequin Formal Party Dress Flutter Short Sleeve Wedding Cocktail Long Evening Dress', '\"About this item\r\n<div>Long Sequin Dress - Soft and breathable fabric with small sequin embellishment is perfect for party. The party lights will shine on you and you will be the most dazzling person in the room.\r\n</div><div>Elegant Maxi Evening Dresses - The short front and long back ruffled hemline frees up your calf line and makes the dress look more elegant, making you more charming and sexy.\r\n</div><div>Comfortable Fabrics - The fabric of this long formal dress is lightweight and flattering to the skin, but breathable, not stuffy, soft and stretchy. This dress is comfortable to wear and drapes better for a more elegant look.\r\n</div><div>The Trendy Sequin Dress is Great for Party, Wedding Guest, Homecoming, Cocktail, Bridesmaid, Dating, Shopping, Street, Graduation,Birthday,Evening. This is a must have dress for any parties! Also an ideal gift for your wife, girlfriend, sister, friend or family.\r\n</div><div>Size Tips - Please read the size chart carefully before ordering (not Amazon size chart). Due to different computer display colors, the actual color may be slightly different from the above picture. Thank you for your understanding.\"</div>', '1269', 76.69, 58.99, 29.5, NULL, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-16 16:44:21', '2025-04-16 16:44:21', NULL, NULL, 249, 0, NULL, 'publish'),
