(266, 'CeraVe Hydrating Facial Cleanser – Face Wash for Dry Skin with Hyaluronic Acid & Ceramides, Eczema Certified', 'cerave-hydrating-facial-cleanser-face-wash-for-dry-skin-with-hyaluronic-acid-ceramides-eczema-certified', 'CeraVe Hydrating Facial Cleanser – Face Wash for Dry Skin with Hyaluronic Acid & Ceramides, Eczema Certified', '\"About this item\r\n<div>[ HYDRATING FACE WASH ] Daily face wash with hyaluronic acid, ceramides, and glycerin to help hydrate skin without stripping moisture. Removes face makeup, dirt, and excess oil, provides 24-hour hydration and leaves a moisturized, non-greasy feel.\r\n</div><div>[ ECZEMA FACE WASH ] Non-foaming cleanser for dry skin with a lotion-like consistency feels smooth as it cleanses, even on sensitive, dry skin. Fragrance-free, paraben-free, non-comedogenic and non-drying. Certified by the National Eczema Association\r\n</div><div>[ MULTI-USE GENTLE CLEANSER ] Cream cleanser for face and/or body and can be used as a hand wash. Suitable for daily cleansing morning (AM) and night (PM) for normal to dry skin. Skin care for dry skin.\r\n</div><div>[ 3 ESSENTIAL CERAMIDES ] Ceramides are found naturally in the skin and make up 50% of the lipids in the skin barrier. All CeraVe products, formulated with three essential ceramides (1, 3, 6-II)to help maintain the skin’s natural barrier.\r\n</div><div>[ DEVELOPED WITH DERMATOLOGISTS &amp; #1 DERMATOLOGIST RECOMMENDED SKINCARE BRAND ] CeraVe Skincare is developed with dermatologists and has products suitable for dry skin, sensitive skin, oily skin, acne-prone, and more.\"</div>', '1316', 18.11, 13.93, 6.97, 1, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-18 08:42:18', '2025-04-18 08:42:18', NULL, NULL, 245, 0, NULL, 'publish'),
(267, 'SimplyVital Collagen Retinol Cream – Anti-Aging Moisturizer for Face, Neck & Décolleté, 1.7 fl oz', 'simplyvital-collagen-retinol-cream-anti-aging-moisturizer-for-face-neck-dcollet-17-fl-oz', 'SimplyVital Collagen Retinol Cream – Anti-Aging Moisturizer for Face, Neck & Décolleté, 1.7 fl oz', '\"About this item\r\n<div>Nourishing Face Moisturizer — Enhance your anti-aging skincare routine with this moisturizing face cream, designed to help your skin feel smooth and refreshed. Collagen supports skin\'s flexibility while promoting a firmer texture for both face and neck. Enjoy a youthful glow with a gentle solution that provides enduring hydration and care.\r\n</div><div>How to Use - Apply a small amount to clean, dry skin, massaging until absorbed. Start 1-2 times a week for sensitive skin, then increase as needed. Use daily for optimal results. Always apply SPF 30+ during the day, as retinol may heighten sun sensitivity. Perform a patch test before initial use. Consult a dermatologist before use. Individual sensitivity to components is possible.\r\n</div><div>Advanced Retinol Face Cream – Formulated with a balanced concentration of retinol, this moisturizer encourages skin renewal for a smoother, refreshed appearance. Hyaluronic acid complements retinol to help maintain hydration, leaving skin feeling soft and nourished without tightness. Perfect for a well-rounded skincare routine.\r\n</div><div>Proudly Made in the USA – SimplyVital guarantees exceptional quality in each jar. We carefully select effective yet gentle components to create potent formulas, ensuring your skin gets the attention it deserves while enhancing your natural elegance. All our products are crafted in the USA, adhering to the highest manufacturing standards.\"</div>', '1323', 31.19, 23.99, 12, 1, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-18 08:45:03', '2025-04-18 08:45:03', NULL, NULL, 245, 0, NULL, 'publish'),
(268, 'Vitamin C Serum 20% – Anti-Aging Face Serum with Hyaluronic Acid, Retinol & Amino Acids, 60ml', 'vitamin-c-serum-20-anti-aging-face-serum-with-hyaluronic-acid-retinol-amino-acids-60ml', 'Vitamin C Serum 20% – Anti-Aging Face Serum with Hyaluronic Acid, Retinol & Amino Acids, 60ml', '\"About this item\r\n<div>Plant Based Formulation - Free of synthetic color additives, fragrance, and stabilizers, dynamic active botanicals like Aloe Vera, Witchhazel, Botanical Hyaluronic Acid, Witch Hazel and organic Jojoba oil combine in a silky smooth serum that can be used day or night.\r\n</div><div>Anti-Aging Vitamin C Serum For Face - As you grow older, the skin loses its vitality, leaving it dull, dry and dehydrated. Vitamin C Serum contains Hyaluronic Acid and botanical blend that helps fight against wrinkles and spots. Including Vitamin C Serum in your daily skin care, helps add moisture on face and skin, nourishes the skin and helps to retain its natural glow.\r\n</div><div>Advanced Antioxidant Serum - An indispensable nutrient for collagen production, vitamin C blends with Botanical Hyaluronic Acid and Vitamin E, designed to target the most common signs of aging, including firmness, fine lines, wrinkles, dark spots &amp; sun spots.\r\n</div><div>Stimulate Collagen Formation - Vitamin C is responsible for collagen production. Boosting your skin and body with Vitamin C Serum will enhance the natural formation of collagen that is the number one component for connecting tissues for skin health. No oily residue left behind. Absorbs quickly without a heavy, greasy or sticky feel.\"</div>', '1324', 12.99, 9.99, 5, 1, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-18 08:47:35', '2025-04-18 08:47:35', NULL, NULL, 245, 0, NULL, 'publish'),
(269, 'Aveeno Protect + Hydrate SPF 60 Sunscreen Lotion – Oil-Free, Paraben-Free with Prebiotic Oat, 12 fl oz', 'aveeno-protect-hydrate-spf-60-sunscreen-lotion-oil-free-paraben-free-with-prebiotic-oat-12-fl-oz', 'Aveeno Protect + Hydrate SPF 60 Sunscreen Lotion – Oil-Free, Paraben-Free with Prebiotic Oat, 12 fl oz', '\"About this item\r\n<div>Daily Sunscreen Lotion: One 12 fl oz lotion pump bottle of Aveeno Protect + Hydrate Sunscreen Broad Spectrum SPF 60 Body Lotion to help protect and provide all-day hydration to skin\r\n</div><div>Moisturizing Sunscreen Lotion: Made with nourishing prebiotic oat, this lightweight daily sunscreen helps leave skin feeling soft and moisturized all day as it combats sun induced free radicals that accelerate skin-aging\r\n</div><div>Water Resistant Sunscreen: Featuring effective broad spectrum protection, this sunscreen lotion SPF 60 is paraben, phthalate, oil, oxybenzone and dye free, and is water and sweat-resistant for up to 80 minutes for superior protection from the sun\r\n</div><div>Sun Protection for Adults: Apply this oil free sunscreen 15 minutes before sun exposure and reapply every two hours or more often as directed\r\n</div><div>Dermatologist Recommended Brand for Over 70 Years: Aveeno Protect + Hydrate Body Sunscreen helps prevent sunburn and decreases the risk of skin cancer and early aging caused by the sun when used as directed with other sun protection measures\"</div>', '1328', 35.45, 27.27, 13.64, 1, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-18 08:50:08', '2025-04-18 08:50:08', NULL, NULL, 245, 0, NULL, 'publish'),
(270, 'Celavi Korean Essence Face Mask Set – 12-Pack Hydrating Sheet Masks', 'celavi-korean-essence-face-mask-set-12-pack-hydrating-sheet-masks', 'Celavi Korean Essence Face Mask Set – 12-Pack Hydrating Sheet Masks', '\"About this item<div>12 Essence Set Includes - Collagen, Seaweed, Honey, pomegranate, Aloe Vera, Vitamin C, Acai Berry, Tea Tree, Avocado, Ginseng, Cucumber, Charcoal</div><div>Made In Korea, Paraben Free, Oil Free, Sulfate Free, Cruelty-Free</div><div>A deeply-hydrating, revitalizing skin therapy helps create firmer, healthier, more balanced skin</div><div>For dry, oily, or sensitive skin\"</div>', '1332', 16.89, 12.99, 6.5, 1, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-18 08:54:41', '2025-04-18 08:54:41', NULL, NULL, 245, 0, NULL, 'publish'),
(271, 'NIVEA Cocoa Butter Body Cream – Deep Nourishing for Dry Skin, 16 oz Jar', 'nivea-cocoa-butter-body-cream-deep-nourishing-for-dry-skin-16-oz-jar', 'NIVEA Cocoa Butter Body Cream – Deep Nourishing for Dry Skin, 16 oz Jar', '\"About this item\r\n<div>Carefully Selected Ingredients: Infused with our Deep Nourishing Serum, Cocoa Butter and Vitamin E\r\n</div><div>Deep Nourishing: This NIVEA body cream nourishes dry skin for visible radiance\r\n</div><div>Multi-Use: Creamy formula for dry skin is also perfect as a hand cream or a moisturizing foot cream\r\n</div><div>Great for Dry Skin: Body cream for dry skin leaves skin intensively hydrated, and radiant after just 1 application\"</div>', '1339', 9.06, 6.97, 3.49, 1, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-18 08:57:27', '2025-04-18 08:57:27', NULL, NULL, 245, 0, NULL, 'publish'),
(272, 'Acne Spot Treatment Cream – 10% Azelaic Acid for Cystic & Hormonal Breakouts, 1.8 oz', 'acne-spot-treatment-cream-10-azelaic-acid-for-cystic-hormonal-breakouts-18-oz', 'Acne Spot Treatment Cream – 10% Azelaic Acid for Cystic & Hormonal Breakouts, 1.8 oz', '\"About this item\r\n<div>Anti-Acne Powerhouse：Clinically proven with 10% Azelaic Acid + 2% Salicylic Acid to reduce cystic acne swelling by 73%* overnight while unclogging pores. Dermatologist-tested for stubborn hormonal breakouts in teens &amp; adults (13-30), this deep-penetrating formula targets acne on face, back, chest, and body without over-drying skin layers.\r\n</div><div>Scar-Fading Complex: Non-comedogenic Niacinamide &amp; Tea Tree Oil visibly fade post-acne marks in 14 days* while calming redness. The environmental-shield formula protects sensitive skin during school/sports/commuting, preventing new breakouts in classrooms, gyms, and workplaces.\r\n</div><div>Rduce Cystic pimples: Relief active cystic pimples while gradually releasing tea tree antioxidants over 8 hours. 72% of users report reduced midday shine* through sebum-control matrix that targets root causes of teen/adult acne.\r\n</div><div>Fast-Absorbing Defense: Ultra-lightweight gel-cream absorbs in 20 seconds (89% trial-proven*) without pilling under makeup/SPF. pH-balanced (5.2-5.8) for daily use on face, bacne areas, and mask-prone zones, maintaining moisture during workouts/humidity.\r\n</div><div>Hygienic Protection System: To maintain ingredient potency &amp; prevent contamination. Cruelty-free &amp; compliant, this travel-friendly 1.8oz bottle for consistent treatment from dorm rooms to business trips.\r\n\"</div>', '1340', 19.49, 14.99, 7.5, 1, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-18 09:00:33', '2025-04-18 09:00:33', NULL, NULL, 245, 0, NULL, 'publish'),
(273, 'Medicube Collagen Overnight Mask – Hydration & Elasticity Care for Glowing Skin, 2.53 fl oz', 'medicube-collagen-overnight-mask-hydration-elasticity-care-for-glowing-skin-253-fl-oz', 'Medicube Collagen Overnight Mask – Hydration & Elasticity Care for Glowing Skin, 2.53 fl oz', '\"About this item\r\n<div>Awaken Your Glow with Overnight Elasticity Booster - Protect and enhance your skin\'s elasticity with our collagen wrapping film, delivering 8 hours of intensive care while you sleep. Perfect for waking up with firmer, more resilient skin.\r\n</div><div>Comes Off in One Piece -Just like there\'s no better feeling than a clean shed, this easy-to-peel mask leaves your face feeling fresh and clean.\r\n</div><div>To avoid confusion, the tube is filled to 80% capacity for safety and secure transport, while the product itself \"\"contains the standard 2.53 fl. oz.\"\"\r\n</div><div>Powerful Ingredients: Ceramide NP for skin barrier and hydration, Collagen Extract for elasticity and youthful complexion, and Adenosine for reducing fine lines through skin renewal\r\n</div><div>Proven Results - Clinical trials show significant improvements with Medicube Collagen Night Wrapping Mask: +31.4% skin elasticity, +24.8% 24-hour moisture retention, and +23.4% skin surface hydration after 2 weeks of use. Individual results may vary.\"</div>', '1343', 24.56, 18.89, 9.45, 1, NULL, 1, 1, NULL, 1, 50, 1, 0, 1, '2025-04-18 09:05:24', '2025-04-18 09:05:24', NULL, NULL, 245, 0, NULL, 'publish'),
